フォグライト用LEDバルブ<br><br>路面を確実に照らす最上級モデル。<br>ランプメーカーが設計した配光性能。<br><br>優れた明るさと高い精度の配光性能<br>対向車に眩しさを与えず、光源の性能を無駄なく路面に照射します。<br><br><br>●熱伝導銅合金<br>熱を後方のヒートシンクに移送します。<br><br>●2層構造のアルミ＆銅合金<br> 熱伝導銅合金をアルミ合金で覆う2層構造により、熱の移送と効率的な放熱を実現しました。<br><br>●電動ファン<br>ファンの風が、移送された熱を冷却します。<br><br>●車検対応<br><br>●日本製<br><br>●HV車＆EV車対応<br><br>※本製品はフォグライト専用です。ヘッドライトには使用できません。<br><br><br>【仕様】<br>タイプ：ホワイト光 HB4<br>ルーメン：2400lm<br>ケルビン：6000K<br>消費電力：12V 16W<br><br>メーカー： PIAA<br>品番：LEF101<style type="text/css">
